import React, { useState } from "react";
import { GetLengths } from './GetLengths.js';

/*
export function DropdownElement(props) {
    return (
        <div>
            <select>
                <option> {props.label} </option>
                <option> Diameter </option>
            </select>
        </div>
    );
}
*/

export function DropdownElement(props) {
    const [lengths, setLengths] = useState([100,110,120,130,140,150,160,170,180,190,200,210,220,230,240,250,260,270,280,290,300,310,320,330,340,350,360,370,380,390,400]);

    return (
        <div>
            <select>
                <h5> {props.label} </h5>
                {lengths.map((length) =>
                    <option> {length} </option>
                )};
            </select>
        </div>
    );
}
